<!DOCTYPE html>
<html>
	<head>
		<meta charset="utf-8">
		<title></title>
	</head>
	<script>
		let o ={
			[Symbol.iterator]:() => ({
				_value:0,
				next(){
					if(this._value == 10){
						return {
							done: true
						}
					}else{
						return {
							value: this._value++,
							done: false
						}
					}
				}
			})
		}
		for(let e of o){
			console.log(e);
		}
	</script>
	<body>
	</body>
</html>
